import React from 'react';
import './Navk.scss';
import logok2 from '../../img/logok2.svg'


const nav = () => (
<nav className='nav'>
    <div>
        <a>
            <img src={logok2} className="logo"></img>
        </a>
    </div>
</nav>);

export default nav;
